// Called when the game starts or when spawned
void Apoint_represtation::BeginPlay()
{
	Super::BeginPlay();

	id = id_counter;
	id_counter++;

	if (!generated_point_array) {

		generated_point_array = true;
		UE_LOG(LogTemp, Warning, TEXT("The id of this object is %i"), id);
	}
	
	UE_LOG(LogTemp, Warning, TEXT("The id of this object is %i"), id);
	
}

// Called every frame
void Apoint_represtation::Tick(float DeltaTime)
{
	Super::Tick(DeltaTime);

	//UE_LOG(LogTemp, Warning, TEXT("The DeltaTime currently is %i"), DeltaTime);

	frame++;
	/*if (frame >= 144) {
		frame = 0;
	}*/

	if (id % 22 == 0) {
		if (frame % 200 == 0) {
			UE_LOG(LogTemp, Warning, TEXT("The id of this object is %i"), id);

			//UE_LOG(LogTemp, Warning, TEXT("The size of the point array is %i"), sizeof(point_array)/sizeof(point_array[0]));


			string filepath = "../Animations/Anim.txt";
			
			FString FileData;
			//FFileHelper::EHashOptions Verification;
			FString FullFilePath = FPaths::ProjectContentDir() + FString(filepath.c_str());
			FFileHelper::LoadFileToString(FileData, *FullFilePath);

			//UE_LOG(LogTemp, Warning, TEXT("The id of this object is %s"), *FileData);

			string FileString = TCHAR_TO_UTF8(*FileData);

			string temp_string = "";

			int AFrame = 0;
			int Point = 0;
			int coordinate = 0;

			int j = 0;

			//char temp_chars[] = {"a"};

			for (int i = 0; i < FileString.size(); i++) {
				if (i < FileString.size() - 1) {
					//temp_chars = { FileString[i], FileString[i + 1] };
					if (FileString[i] == *"\n") {
						//UE_LOG(LogTemp, Warning, TEXT("Found a line break"));
						
						if (FileString[i - 2] == *"[") {
							coordinate = 0;
						}

						// first identify if we need to save a number, and do that
						if (FileString[i + 1] == *"]") {
							
							//UE_LOG(LogTemp, Warning, TEXT("coordinate before ]: %i"), coordinate);
							//UE_LOG(LogTemp, Warning, TEXT("position of point %i"), Point);
							temp_string = FileString.substr(j, i - j);
							point_array[AFrame][Point-1][coordinate] = stod(temp_string);
							//UE_LOG(LogTemp, Warning, TEXT("point number %s"), temp_string);
						}
						// && FileString[i-1] != *"["
						else if (FileString[i + 1] == *"\t" && FileString[i - 2] != *"[") {
							//UE_LOG(LogTemp, Warning, TEXT("coordinate elsewhere %i"), coordinate);
							//UE_LOG(LogTemp, Warning, TEXT("position of point %i"), Point);
							temp_string = FileString.substr(j, i - j);
							point_array[AFrame][Point-1][coordinate] = stod(temp_string);
							//UE_LOG(LogTemp, Warning, TEXT("point number %s"), temp_string);
							coordinate++;
						}

						// then save the current place if applicable in preperation for the 
						if (FileString[i+1] == *"\t") {
							j = i + 1;
							//coordinate++;
						}
						else if (FileString[i + 1] == *"F") {
							AFrame++;
							Point = 0;
							//coordinate = 0;
						}
						else if (FileString[i + 1] == *"P") {
							Point++; 
							//coordinate = 0;
						}
						
					}
				}
			}
			number_of_frames = AFrame;
		}
	}

	if (id < 22) {
		//FVector coords;
		coords.X = point_array[frame % number_of_frames][id][0] * 100;
		coords.Z = point_array[frame % number_of_frames][id][1] * 100;
		coords.Y = point_array[frame % number_of_frames][id][2] * 100;
		// double coords[3] = point_array[0][id];
		// SetActorLocation(coords);
	}
	else {
		coords.X = point_array[frame % number_of_frames][id % 22][0] * 100;
		coords.Z = point_array[frame % number_of_frames][id % 22][1] * 100;
		coords.Y = point_array[frame % number_of_frames][id % 22][2] * 100;
	}
	//UE_LOG(LogTemp, Warning, TEXT("The id of this object is %i"), id);
}

